import { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Search.css";
const Search = () => {
  const [user, setUser] = useState("");
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    navigate(`/${user}`);
  };

  return (
    <>
      <div className="search_page_title">Titttteellll</div>
      <div className="search_page_subtitle">subffsfa sfa sfasf afasf</div>
      <div className="search_page_search" onSubmit={(e) => handleSubmit(e)}>
        <input
          className="search_input"
          value={user}
          type="text"
          onChange={(e) => setUser(e.target.value)}
          placeholder="Search User"
        />
        <button>GO</button>
      </div>
    </>
  );
};

export default Search;
